import React, { useState, useEffect } from 'react';
import axios from 'axios';

export default function AdminPanel() {
  const [routes, setRoutes] = useState([]);
  const [newRoute, setNewRoute] = useState({
    from: '',
    to: '',
    date: '',
    price: ''
  });

  // Получить все маршруты (запрос на сервер)
  useEffect(() => {
    async function fetchRoutes() {
      try {
        const response = await axios.get('/admin/routes');
        setRoutes(response.data);
      } catch (error) {
        console.error('Ошибка при получении маршрутов:', error);
      }
    }

    fetchRoutes();
  }, []); // Пустой массив - запрос выполняется только при монтировании компонента

  // Обработчик формы добавления маршрута
  const handleAddRoute = async (e) => {
    e.preventDefault();
    try {
      const response = await axios.post('/admin/routes', newRoute); // Запрос на добавление маршрута
      setRoutes([...routes, response.data]); // Добавляем новый маршрут в состояние
      setNewRoute({ from: '', to: '', date: '', price: '' }); // Очищаем форму
      alert('Маршрут добавлен!');
    } catch (error) {
      console.error('Ошибка при добавлении маршрута:', error);
      alert('Ошибка при добавлении маршрута');
    }
  };

  // Обработчик удаления маршрута
  const handleDeleteRoute = async (id) => {
    try {
      await axios.delete(`/admin/routes/${id}`);
      setRoutes(routes.filter(route => route._id !== id)); // Удаляем маршрут из состояния
      alert('Маршрут удалён!');
    } catch (error) {
      console.error('Ошибка при удалении маршрута:', error);
      alert('Ошибка при удалении маршрута');
    }
  };

  return (
    <div className="admin-container">
      <header className="admin-header">
        <h1 className="admin-title">Панель администратора</h1>
        {/* Ваши кнопки и другие элементы */}
      </header>

      <div className="admin-content">
        <h2>Управление маршрутами</h2>

        {/* Форма для добавления маршрута */}
        <form onSubmit={handleAddRoute}>
          <input
            type="text"
            value={newRoute.from}
            onChange={(e) => setNewRoute({ ...newRoute, from: e.target.value })}
            placeholder="Откуда"
            required
          />
          <input
            type="text"
            value={newRoute.to}
            onChange={(e) => setNewRoute({ ...newRoute, to: e.target.value })}
            placeholder="Куда"
            required
          />
          <input
            type="date"
            value={newRoute.date}
            onChange={(e) => setNewRoute({ ...newRoute, date: e.target.value })}
            required
          />
          <input
            type="number"
            value={newRoute.price}
            onChange={(e) => setNewRoute({ ...newRoute, price: e.target.value })}
            placeholder="Цена"
            required
          />
          <button type="submit">Добавить маршрут</button>
        </form>

        {/* Таблица маршрутов */}
        <table className="routes-table">
          <thead>
            <tr>
              <th>Откуда</th>
              <th>Куда</th>
              <th>Дата</th>
              <th>Цена</th>
              <th>Действия</th>
            </tr>
          </thead>
          <tbody>
            {routes.map((route) => (
              <tr key={route._id}>
                <td>{route.from}</td>
                <td>{route.to}</td>
                <td>{route.date}</td>
                <td>{route.price} ₽</td>
                <td>
                  <button onClick={() => handleDeleteRoute(route._id)} className="delete-btn">
                    Удалить
                  </button>
                </td>
              </tr>
            ))}
          </tbody>
        </table>
      </div>
    </div>
  );
}
